	/**
	 * 计算给定长度数据的16位CRC。
	 * @param pData
	 * @param nLength
	 * @return
	 */
	private final static short GetCrc16(byte[] pData, int nLength)
	{
		short fcs = (short) 0xffff;    // 初始化
	    int i;
	    for(i=0;i<nLength;i++)
	    {
	        fcs = (short) (((fcs & 0xFFFF) >>> 8) ^ crctab16[(fcs ^ pData[i]) & 0xff]);
	    }
	    return (short) ~fcs;
	}
	/**
	 * 计算Crc16
	 * @param data
	 * @return
	 */
	public final static  short crc16(byte[] data){
	    return GetCrc16(data, data.length);
	}
	
